    'Originally, cron is a Unix system tool that provides time-based job scheduling: you can create many cron jobs, which are then run periodically at fixed times, dates, or intervals.' => 'Orixinalmente, cron é unha ferramenta do sistema Unix que permite programar tarefas ao longo do tempo: podes crear moitas tarefas cron que logo se executan periodicamente nuns horarios, datas ou intervalos fixos.',
    'This module provides you with a cron-like tool: you can create jobs which will call a given set of secure URLs to your PrestaShop store, thus triggering updates and other automated tasks.' => 'Este módulo proporciónache unha ferramenta cron: podes crear tarefas que chamarán a un determinado conxunto de URLs seguros da túa tenda Prestashop, as cales porán en marcha actualizacións e outras tarefas automatizadas.',
    'Do not forget to use an absolute URL in the target link to make it valid! The link also has to be on the same domain as the shop.' => 'Non esquezas empregar un URL absoluto na ligazón de destino para que sexa válido! A ligazón tamén ten que estar no mesmo dominio que a tenda.',
    'Become an e-commerce expert in leaps and bounds!' => 'Faite unha experta en comercio electrónico a grandes pasos!',
    'With all of the great features and benefits that PrestaShop offers, it\'s important to keep up!' => 'Con tódalas fantásticas funcionalidades e beneficios que ofrece PrestaShop, é importante estar ao día!',
    'The main goal of all of the features we offer is to make you succeed in the e-commerce world. In order to accomplish this, we have created a system of badges and points that make it easy to monitor your progress as a merchant. We have broken down the system into three levels, all of which are integral to success in the e-commerce world: (i) Your use of key e-commerce features on your store; (ii) Your sales performance; (iii) Your presence in international markets.' => 'O obxectivo principal de todas estas funcionalidades que ofrecemos é que teñas éxito no mundo do comercio electrónico. Para conseguir isto, creamos un sistema de insignias e puntos que fan doado supervisar o teu progreso como comerciante. Dividimos o sistema en tres niveis, os cales son esenciais para acada-lo éxito no mundo do comercio electrónico: (i) O teu emprego das principais funcionalidades do comercio electrónico na túa tenda; (ii) O rendemento das túas vendas; (iii) A túa presenza en mercados internacionais.',
    'The more progress your store makes, the more badges and points you earn. No need to submit any information or fill out any forms; we know how busy you are, everything is automatic!' => 'Canto máis progresa a túa tenda, máis insignias e puntos gañas. Non é preciso enviar ningunha información ou encher ningún formulario; sabemos o ocupada que estás, todo é automático!',
