  'ModulesStatsregistrationsAdmin' => 
  array (
    'Customer accounts' => 'Contas da Clientela',
    'Adds a registration progress tab to the Stats dashboard.' => 'Engade unha sección co progreso dos rexistros no panel de Estatísticas.',
    'Number of visitors who stopped at the registering step:' => 'Número de visitantes que abandonaron na etapa de rexistro:',
    'Number of visitors who placed an order directly after registration:' => 'Número de visitantes que realizaron unha encomenda xusto despois do rexistro:',
    'Total customer accounts:' => 'Total de contas de clientas/es:',
    'Number of customer accounts created' => 'Número de contas de clienta/e creadas',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track. You feel me?' => 'O número total de contas creadas non é en si unha información importante. Con todo, é beneficioso para analizar-lo número de contas creadas ao longo do tempo. Isto vai indicar se as cousas van ben ou non. Séguesme?',
    'How to act on the registrations\' evolution?' => 'Como actuar respecto da evolución dos rexistros?',
    'If you let your shop run without changing anything, the number of customer registrations should stay stable or show a slight decline.' => 'Se deixas a túa tenda funcionar sen mudar nada, o número de rexistros de clientas podería permanecer estable ou presentar un lixeiro descenso.',
    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'Un aumento ou diminución significativa no rexistros de clientas denota que probablemente houbo un cambio na túa tenda. Con iso en mente, suxerímosche identifica-la causa, corrixi-lo problema e volver facer cartos!',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Velaquí tes un resumo do que pode estar a afectarlle á creación de contas de clienta:',
    'An advertising campaign can attract an increased number of visitors to your online store. This will likely be followed by an increase in customer accounts and profit margins, which will depend on customer "quality." Well-targeted advertising is typically more effective than large-scale advertising... and it\'s cheaper too!' => 'Unha campaña publicitaria pode atraer e incrementa-lo número de visitas á túa tenda. Isto probablemente virá seguido dun incremento das contas de clienta e das marxes de beneficio, o cal dependerá da "calidade" da clienta. A publicidade ben segmentada é normalmente máis eficaz que a publicidade a grande escala... e tamén máis barata!',
    'Specials, sales, promotions and/or contests typically demand a shoppers\' attentions. Offering such things will not only keep your business lively, it will also increase traffic, build customer loyalty and genuinely change your current e-commerce philosophy.' => 'Polo xeral, as ofertas, rebaixas, promocións e/ou concursos chaman a atención das compradoras. Ofrecendo estas cousas non só manterás activo o teu negocio, tamén incrementará o tráfico, contribuirá á fidelización da clientela e cambiará sinceramente a túa filosofía actual de comercio electrónico.',
    'Design and user-friendliness are more important than ever in the world of online sales. An ill-chosen or hard-to-follow graphical theme can keep shoppers at bay. This means that you should aspire to find the right balance between beauty and functionality for your online store.' => 'O deseño e a usabilidade son máis importantes ca nunca no mundo das vendas online. Un tema mal escollido ou difícil de seguir pode disuadir as compradoras. Isto quere dicir que deberías procurar atopa-lo xusto equilibrio entre beleza e funcionalidade na túa tenda online.',
    'CSV Export' => 'Exportar CSV',
  ),
  'ModulesStatssalesAdmin' => 
  array (
    'Sales and orders' => 'Vendas e pedidos',
    'Adds graphics presenting the evolution of sales and orders to the Stats dashboard.' => 'Engade gráficos no panel de Estatísticas que presentan a evolución de vendas e pedidos.',
    'About order statuses' => 'Sobre o estado dos pedidos',
    'In your Back Office, you can modify the following order statuses: Awaiting Check Payment, Payment Accepted, Preparation in Progress, Shipping, Delivered, Canceled, Refund, Payment Error, Out of Stock, and Awaiting Bank Wire Payment.' => 'No teu Panel de Administración podes modifica-los seguintes estados dos pedidos: Agardando a Comprobación do Pagamento, Pagamento Aceptado, Preparación en Marcha, Enviado, Entregado, Cancelado, Reembolsado, Erro de Pagamento, Fóra de Stock e Agardando o Pagamento por Transferencia Bancaria.',
