  'ModulesStatsvisitsAdmin' => 
  array (
    'Visits and Visitors' => 'Visitas e visitantes',
    'Adds statistics about your visits and visitors to the Stats dashboard.' => 'Engade estatísticas sobre as túas visitas e visitantes no panel de Estatísticas.',
    'Determine the interest of a visit' => 'Determina o interese dunha visita',
