    'If this is the case, congratulations, your website is well planned and pleasing. Glad to see that you\'ve been paying attention.' => 'Se é o caso, parabéns, o teu web está ben planificado e é agradable. Ficamos felices ao ver que estiveches prestando atención.',
    'Otherwise, the conclusion is not so simple. The problem can be aesthetic or ergonomic. It is also possible that many visitors have mistakenly visited your URL without possessing a particular interest in your shop. This strange and ever-confusing phenomenon is most likely cause by search engines. If this is the case, you should consider revising your SEO structure.' => 'Se non, a conclusión non é tan sinxela. O problema pode ser estético ou ergonómico. Tamén é posible que moitas visitantes teñan visitado a túa URL por erro, sen ter un interese particular na túa tenda. Este estraño e sempre confuso fenómeno ten a súa causa máis probable nos motores de busca. Se este é o caso, deberías considerar revisa-la túa estrutura SEO.',
    'This information is mostly qualitative. It is up to you to determine the interest of a disjointed visit.' => 'Esta información e principalmente cualitativa. Depende de ti determina-lo interese dunha visita desconexa.',
    'A visit corresponds to an internet user coming to your shop, and until the end of their session, only one visit is counted.' => 'Unha visita correspóndese cunha usuaria da internet que acode á túa tenda, e ata o final da súa sesión, só se conta unha visita.',
    'A visitor is an unknown person who has not registered or logged into your store. A visitor can also be considered a person who has visited your shop multiple times.' => 'Unha visitante é unha persoa descoñecida que non se rexistrou nin iniciou sesión na túa tenda. Tamén pode considerarse que unha visitante é unha persoa que visitou a túa tenda múltiples veces.',
